import React from 'react'
import ReactStars from "react-rating-stars-component";

const RatePost = () => {

    const thirdExample = {
        size: 20,
        count: 5,
        isHalf: false,
        value: 4,
        color: "#",
        activeColor: "red",
        onChange: newValue => {
          console.log(`Example 3: new value is ${newValue}`);
        }
      };
      
  return (
    <div>
        <div>
          
        <ReactStars {...thirdExample} />
        </div>
    </div>
  )
}

export default RatePost
